import React, { Component } from "react";
import Layout from "../components/Layout";
import { Segment, Header, Image, List, Grid } from "semantic-ui-react";

class index extends Component {
  render() {
    return (
      <Layout>
        <Segment
          style={{
            margin: "",
            backgroundColor: "black",
            padding: "10% 0 10% 0",
            width: "100%",
          }}
        >
          <Grid>
            <Grid.Row columns={3}>
              <Grid.Column></Grid.Column>
              <Grid.Column>
                <Header as="h1" content="SECURITY IN YOUR HANDS" />
                <Header as="h2" inverted icon="lock" />
              </Grid.Column>
              <Grid.Column></Grid.Column>
            </Grid.Row>
          </Grid>

          <Header
            inverted
            textAlign="center"
            as="h1"
            content="Get your secure wallet today!"
          />
        </Segment>
      </Layout>
    );
  }
}

export default index;
